import React from "react";

function GetUser() {
  return (
    <>
      <table>
        <tbody>
          <tr>
            <td>Name</td>
            <td>User Name</td>
            <td>Action</td>
          </tr>
        </tbody>
      </table>
    </>
  );
}
export default GetUser;
